B.HK=new A.aB("\n\nDear Colleagues,\n\nWelcome to Memphis, TN and the lovely Guest House at Graceland.  Thank you for joining us for the 2023 Southeastern Writing Centers Association Conference.  It has been a long time coming!  Little did we know that when\u2014in February 2020\u2014we were talking about hosting the SWCA conference, those plans would be put on hold until 2023.  We could not be prouder to welcome you finally and to continue our collaboration with you in person.",null,B.j,B.D)
B.HA=new A.aB("\n\nThe SWCA conference has always been a special gathering.  By bringing together writing center directors, graduate student consultants, undergraduate student consultants, high school student consultants, professional consultants, and writing center staff, this conference paves a way for focusing on our important work from the aspects of multiple audiences and contexts.  We do this by adhering to a theme that points us toward current research we use for growth.  I am never disappointed in what I learn at an SWCA conference, and I am always sad to see the three days end.  Based on the proposals I\u2019ve read, I believe this year will not be different.",null,B.j,B.D)
B.I5=new A.aB("\n\nThis year our theme is \u201cNavigating the Rivers of Change,\u201d where I   have asked you to use Memphis as inspiration.  As a place of resilience and survival, Memphis has a rhythm all on its own, a place that wants change, a place that keeps pushing forward, despite constant setbacks that hinder that progress.  I\u2019ve asked you to think about how this mentality relates to what we do in our writing centers, focusing on our rhythms, our challenges, and ways we encounter setbacks that seemingly step in the way of much-needed progress.",null,B.j,B.D)
B.HI=new A.aB("\n\nThe session topics have risen to the task.  In this conference we will hear about multimodal work, cultural awareness, social and economic change, campus culture, multilingual work decolonization, power dynamics, safe spaces, inclusion, diversity, accessibility, standard language ideology, equitable practices, activism, neurodiversity, equity, justice, work and life balance, antiracist tutoring, unconscious bias, mental health, and many other topics that are rich for conversation in the context of writing center work.  Many of these are in the context of RAD scholarship, data analysis, and training that give avenues for continued conversation and collaboration.",null,B.j,B.D)
B.Hw=new A.aB("\n\nThese topics are also rich kindling for wider application after we leave this place.  Writing centers have always been places of change; that\u2019s a given.  Let\u2019s dive in and talk about our navigation around those changes and how they open opportunities for more advocacy.  I look forward to hearing the buzz after our powerful sessions that will surely happen long after we\u2019ve returned to our institutions.",null,B.j,B.D)
B.Hl=new A.aB("\n\nI wish to thank all the helpers who have made this conference possible:",null,B.j,B.D)
B.Ib=new A.aB("\n   \u2022The CBU Writing and Communications Corner consultants have been both patient and focused for three years, always believing this conference would happen.     Please read my detailed acknowledgement page to see some blurbs about how these consultants have been my heroes during this whole process.\n   \u2022The SWCA Board has been supportive throughout, understanding, offering advice, and making sure I had everything I needed.  The Board membership is listed on    one of the program links on the homepage.\n   \u2022The Proposal Review Committee was a life saver for me, saving me countless hours and offering insight that helped with all aspects of programming.  This    committee membership is listed in a program homepage link as well.",null,B.j,B.D)
B.Hm=new A.aB("This conference would not have happened if you had not come!  Thank you very much  for being here.  I  hope you enjoy the conference, learn a lot of things to take back to your institutions, and make connections with both old and new colleagues and friends.\n\nClayann Gilliam Panetta, 2023 SWCA Conference Host",null,B.j,B.D)
