B.HE=new A.aB("\n\nHello, my name is Luis Arteaga, a consultant from CBU's Writing Center and Communication Corner. If you liked the program enough and have any business inquires, please contact me at\n\nls.studios23@gmail.com\n\nI have gained proficiency in Google's Flutter framework as well as the langauge dart. The benefit of this framework is its power in versitality with web development as well as app development for both andriod and iOS.\n\nEnjoy the conference!",null,B.j,B.D)
