B.HD=new A.aB("\n\nThe 2023 SWCA conference would not have been possible without the contributions of the people below.  We offer our deepest thanks to: ",null,B.j,B.D)
B.HS=new A.aB("\n\n\n\nCBU Writing and Communications Corner Consultants:",null,B.j,B.ad)
B.Hu=new A.aB("\n\nLuis Aretega: Luis was the creator of the online program, giving us a chance to go paperless and do a small part for the Earth.  As a Computer Science major, Luis learned more about his field and writing centers at the same time\u2013what a wonderful combination of knowledge!\n\nZaira Bautista: As our WCC social media specialist, Zaira kept us afloat, when our attention was on the conference, making sure CBU students knew we were still there for them.  Zaira has also been a wonderful contributor to all the small jobs and is always willing to offer excellent advice.\n\nEquilla Beasley: As a contributor to the online version of the program in the early days, Equilla was able to use his computer science major to troubleshoot several logistics necessary to get the idea off the ground.  Equilla also keeps us grounded with his kind demeanor and smile.\n\nCarrie Clowes: Carrie worked as an intern during the Summer of 2022 and was instrumental in creating the conference t-shirt, the name tag design, and our corporate sponsor letter.  She is also a wonderful springboard for ideas and has been willing to put any effort toward making this event a success.\n\nCandice Harris: Candice worked as an intern during the Summer of 2022 and was instrumental in creating the conference t-shirt, the name tag design, and our corporate sponsor letter.  Most notable was Candice\u2019 tireless efforts to make our IWCA presentation a success in November, something that was near impossible without her, given our SWCA conference buzz.\n\nCaleb Jones: Caleb did all the groundwork to help us locate the Board dinner spot and  bring My Cup of Tea to us as a local philanthropy.  Caleb\u2019s listening ear was also extremely valuable when his director/host of the SWCA conference needed a sounding board.\n\nLauren Malone: As a senior headed to optometry school, Lauren doesn\u2019t have much time, but she has been available to complete several small tasks related to the conference that were instrumental in making the conference a success.  When you look around at the little things that you take for granted (those easels for the poster presentations, for instance!), keep in mind Lauren was probably responsible for those things being in place.\n\nChelsea Paname\xf1o: Chelsea worked as an intern during the Summer of 2022 and was instrumental in creating the conference t-shirt, the name tag design, and our corporate sponsor letter.  She has also worked on a team to make the Writing Table at the conference happen.  In addition, she has taken the reins on our Poetry on Demand workshop we will offer right after the conference, something we would not be able to pull off without her.\n\n",null,B.j,B.D)
B.I_=new A.aB("Hannah Rhode: Through a lot of diligence, Hannah talked to multiple Memphis excursion possibilities and helped us map out a plan we could share with conference attendees.  Her attention to detail and professionalism is admirable.\n\nAndy Molina Rodr\xedguez: As one of the WCC work study students, Andy is always ready to stuff packets, run errands, make calls.  It\u2019s the small things that make events a success, and Andy is the master of all those small things.\n\nLara Stearsman: As a work study student, Lara was always ready to do the \u2018lil things she always is good at making happen.  As a Creative Writing major, she worked closely with the writing table and made executive decisions that made the table a creative idea.\n\nEthan Tatom:  Ethan\u2019s tireless efforts in helping think through the Writing Table and Pronoun Table have made those two areas come to life and be the contribution we wanted them to be.  If you haven\u2019t done so already, consider purchasing one of Ethan\u2019s buttons (QR code on pronoun table).  A portion of the proceeds go to the programming necessities of Memphis Pride.\n\nJennifer Velazquez:  Jennifer is getting ready for law school, but this didn\u2019t mean she didn\u2019t help form much of the foundation of the conference.  She put together the beginning program, helped film our Memphis shorts, and provided support for us throughout the process.\n\nAstrid Zuniga: Astrid did all the legwork in getting us in touch with the band in the early days and helped us get the idea off the ground.  The band is great, but they would not be here without Astrid.\n\n",null,B.j,B.D)
B.Hp=new A.aB("\n\nConference Interns:",null,B.j,B.ad)
B.Hx=new A.aB("\n\nSarah Abudalla: Sarah has been instrumental for a lot of small tasks that have been the glue to keep us together in the weeks before the conference.  From scoring some SWAG to making all our name tags, Sarah has been irreplaceable.\n\nAnna Grace Barnett:  Although late to the team, Anna Grace has stepped up and used her creative talents to bring the writing table to fruition.\n\nKirsten Cox:  As a Business major who is working on this internship as part of a Management course requirement, Kirsten has brought her course theory in management and applied it to our conference.  She is getting a great experience, but we are getting her talents and energy.\n\nSean Wyatt: As an English for Corporate Communications major working on this internship to earn credit for his Advanced Professional Communications course, Sean has been responsible for creating the awards slideshow and several other communicative projects.  After the conference, Sean will use his professional communications skills to help our WCC build a community writing center in Memphis.\n\n",null,B.j,B.D)
B.HH=new A.aB("\n\nCBU Faculty",null,B.j,B.ad)
B.HN=new A.aB("\n\nSeveral CBU faculty have shown up to help us make the conference run more smoothly.  They are listed below:\n\nShima Farhesh, Assistant Professor  in Literature and Languages and Placement Coordinator for first year writing\nJacob Goessling, Assistant Professor in Literature and Languages and Director of CBU\u2019s Sustainability Program\nKaren Golightly, Chair of Department of Literature and Languages at CBU\nBrother Alan Parham, Christian Brother and member of Campus Ministries staff.  Brother Alan conducts the WCC Journaling Workshop \nTawny LeBouef Tullia, Dean of the School of Arts ",null,B.j,B.D)
B.HF=new A.aB("\n\n\n\nSomeone who deserves her own category:",null,B.j,B.ad)
B.HJ=new A.aB("\n\nAriel Earnest, the former WCC assistant, who lost her assistant job during COVID, but felt so connected to the SWCA conference plans that she came back to join us and see the conference take place.  Ariel is  a rock star, and we are grateful for her constant participation.  And, folks, she is a civil engineer!",null,B.j,B.D)
B.I0=new A.aB("\n\n\n\nGuest House Staff",null,B.j,B.ad)
B.HT=new A.aB("\n\nWe are grateful for the Guest House staff who were patient with all our questions and ideas throughout this process, especially when it was their predecessors who originally formed our plans with us:\nDennis Norton, Guest House Event Coordinator\nJeffrey Bell, Guest House AV Coordinator",null,B.j,B.D)
B.Hq=new A.aB("\n\n\n\nConference Sponsors",null,B.j,B.ad)
B.HY=new A.aB("\n\nNOVA Southeastern University\u2019s M.A. program in composition, rhetoric, and digital media sponsored coffee breaks and purchased a table to advertise their programs.\nTwenty Six Design purchased and staffed a vendor table with information about WCONLINE\nWLN: A Journal of Writing Center Scholarship contributed information about getting published in this journal.",null,B.j,B.D)
B.Hz=new A.aB("\n\n\n\nLocal on Main Restaurant in Downtown Memphis",null,B.j,B.ad)
B.Hs=new A.aB("\n\nWhen asked to coordinate the Board dinner, Tim Quinn was willing to accommodate our dietary requests with no question.  His cooperative spirit made the process easier on all of us.",null,B.j,B.D)
